import React from 'react';
import Header from '../component/Header';

class Album extends React.Component {
  constructor() {
    super();
    this.state = {
      artist: '',
      album: '',
      albumList: '',
    };
  }

  render() {
    return (
      <div data-testid="page-album">
        <Header />
      </div>
    );
  }
}

export default Album;
